import React from 'react';
import { Image, Divider, Container } from 'semantic-ui-react';
import logo from './logo.png';
import Logout from './Logout';

export const Header = () => {
  return(
      <Container>
        <Image src={logo} centered />
        localStorage.token ? <Logout/> :;
        <Divider/>
      </Container>
  )
};
